    # 获取所有楼盘的详细介绍链接地址
    def get_detail_url(self):
        result = self.get_one_url()
        more_info = []
        more_info_finall = []

        for i in result:
            selector = self.send_request(i)
            # 获取详细信息的URL
            more_info_result = selector.xpath('//*[@id="orginalNaviBox"]//a[2]/@href')
            more_info.append(more_info_result[0])

        # 对返回的详细信息的URL加上前缀https
        for i in more_info:
            i = "https:" + i
            more_info_finall.append(i)
        print(more_info_finall)
        return more_info_finall

